import React from 'react'

interface IButtonProps{
  buttonLabel: string;
}
interface IButtonState{
  type: string,
  text: string
}

class Button extends React.Component<IButtonProps, IButtonState>{

  componentDidMount(): void {
    this.setState({
      type: 'Primary',
      text: this.props.buttonLabel
    })
  }
  render(){
    return (
      <>
        <button className="w-28 m-8 h-10 text-pink-400 bg-white rounded-lg hover:-translate-y-0.5  duration-300">{this.props.buttonLabel}</button>
      </>
    )
  }
}


export default Button
